import{_ as e,o as t,c as a,O as n}from"./chunks/framework.9482e208.js";const v=JSON.parse('{"title":"§ 32.1-368 Breast and Cervical Cancer Prevention and Treatment Fund established.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/32.1-368.md","filePath":"vacode/32.1-368.md"}'),r={name:"vacode/32.1-368.md"},i=n('<h1 id="§-32-1-368-breast-and-cervical-cancer-prevention-and-treatment-fund-established" tabindex="-1">§ 32.1-368 Breast and Cervical Cancer Prevention and Treatment Fund established. <a class="header-anchor" href="#§-32-1-368-breast-and-cervical-cancer-prevention-and-treatment-fund-established" aria-label="Permalink to &quot;§ 32.1-368 Breast and Cervical Cancer Prevention and Treatment Fund established.&quot;">​</a></h1><p>A. There is hereby created in the state treasury a special nonreverting fund to be known as the Breast and Cervical Cancer Prevention and Treatment Fund, hereafter referred to as &quot;the Fund.&quot; The Fund shall be established on the books of the Comptroller and shall be administered by the Director of the Department of Medical Assistance Services. Any moneys remaining in the Fund at the end of each fiscal year, including interest earned thereon, shall not revert to the general fund but shall remain in the Fund.</p><p>B. The Fund shall consist solely of (i) revenues received by the Commonwealth from voluntary contributions of tax refunds pursuant to the provisions of § <a href="http://law.lis.virginia.gov/vacode/58.1-344.3/" target="_blank" rel="noreferrer">58.1-344.3</a> that are paid into the state treasury and deposited to the Fund, (ii) specifically designated federal funds, and (iii) any other private grants, donations, gifts, or bequests designated for the Fund.</p><p>2009, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?091+ful+CHAP0026" target="_blank" rel="noreferrer">26</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?091+ful+CHAP0521" target="_blank" rel="noreferrer">521</a>.</p>',4),s=[i];function o(d,l,c,h,f,u){return t(),a("div",null,s)}const _=e(r,[["render",o]]);export{v as __pageData,_ as default};
